import { Grid } from '@material-ui/core';
import StepperList from '../components/StepperList';

const MainPage = () => {
    return (
        <Grid container direction="column" justify="center" alignItems="center" spacing={5}>
            <StepperList />
        </Grid>
    );
}

export default MainPage;
